    "If the photos you submit are rejected, try moving the computer or camera orientation to change the lighting angle.  The most common reason for rejection is inability to read the text on the ID card.": "G\u00f6nderdi\u011finiz foto\u011fraflar reddedilirse, ayd\u0131nlatma a\u00e7\u0131s\u0131n\u0131 de\u011fi\u015ftirmek i\u00e7in bilgisayar\u0131 veya kamera y\u00f6n\u00fcn\u00fc hareket ettirmeyi deneyin. En yayg\u0131n reddetme nedeni, kimlik kart\u0131ndaki metnin okunamamas\u0131d\u0131r.",
    "If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "Bir alt b\u00f6l\u00fcm\u00fcn son tarihi yoksa, \u00f6\u011frenciler cevaplar\u0131n\u0131 de\u011ferlendirmeye g\u00f6nderdi\u011finde notlar\u0131n\u0131 g\u00f6r\u00fcrler.",
    "If the unit was previously published and released to learners, any changes you made to the unit when it was hidden will now be visible to learners.": "E\u011fer \u00fcnite \u00f6\u011frencilere daha \u00f6nce a\u00e7\u0131ld\u0131 ve yay\u0131nland\u0131ysa, gizliyken \u00fcnitede yapt\u0131\u011f\u0131n\u0131z t\u00fcm de\u011fi\u015fiklikler \u015fimdi \u00f6\u011frencilere g\u00f6r\u00fcn\u00fcr olacak.",
    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "E\u011fer \u00fcnite \u00f6nceden yay\u0131nlanm\u0131\u015f ve \u00f6\u011frencilere a\u00e7\u0131lm\u0131\u015fsa, \u00fcnite gizliyken yapt\u0131\u011f\u0131n\u0131z de\u011fi\u015fiklikler \u00f6\u011frencilere art\u0131k g\u00f6r\u00fcn\u00fcr olacak. Devam etmek istiyor musunuz?",
    "If you do not yet have an account, use the button below to register.": "Hen\u00fcz bir hesab\u0131n\u0131z yoksa, kay\u0131t i\u00e7in a\u015fa\u011f\u0131daki d\u00fc\u011fmeyi kullan\u0131n.",
    "If you leave this page without saving or submitting your response, you will lose any work you have done on the response.": "E\u011fer sayfadan cevab\u0131n\u0131z\u0131 kaydetmeden ya da g\u00f6ndermeden ayr\u0131l\u0131rsan\u0131z, cevap i\u00e7in yapt\u0131\u011f\u0131n\u0131z i\u015flemleri kaybedeceksiniz.",
    "If you leave this page without submitting your peer assessment, you will lose any work you have done.": "Bu sayfay\u0131 \u00f6zde\u011ferlendirmenizi yazmadan terk etmeniz durumunda, yapt\u0131\u011f\u0131n\u0131z t\u00fcm i\u015fleri kaybedeceksiniz.",
    "If you leave this page without submitting your self assessment, you will lose any work you have done.": "Bu sayfay\u0131 de\u011ferlendirmenizi yazmadan terk etmeniz durumunda, yapt\u0131\u011f\u0131n\u0131z t\u00fcm i\u015fleri kaybedeceksiniz.",
    "If you leave this page without submitting your staff assessment, you will lose any work you have done.": "Bu sayfay\u0131 ekip de\u011ferlendirmenizi yazmadan terk etmeniz durumunda, yapt\u0131\u011f\u0131n\u0131z t\u00fcm i\u015fleri kaybedeceksiniz.",
    "If you leave, you can no longer post in this team's discussions.Your place will be available to another learner.": "E\u011fer ayr\u0131l\u0131rsan\u0131z, art\u0131k bu tak\u0131m\u0131n tart\u0131\u015fmalar\u0131na ileti g\u00f6nderemeyeceksiniz. Sizin yeriniz ba\u015fka bir \u00f6\u011frenci i\u00e7in uygun olacak.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "E\u011fer \u00f6nemli de\u011fi\u015fiklikler yaparsan\u0131z, bu de\u011fi\u015fiklikleri yapmadan \u00f6nce tak\u0131m\u0131n \u00fcyelerini bilgilendirdi\u011finizden emin olun.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "E\u011fer bu %(xblockType)s bile\u015fenini \u00f6\u011frencilere g\u00f6r\u00fcn\u00fcr yaparsan\u0131z, yay\u0131nlanma tarihi ge\u00e7tikten ve \u00fcniteyi yay\u0131mlad\u0131ktan sonra \u00f6\u011frenciler bu i\u00e7eri\u011fi g\u00f6rebilecek. Sadece \u00f6\u011frencilerden a\u00e7\u0131k\u00e7a gizlenen \u00fcniteler %(xblockType)s i\u00e7in bu se\u00e7enek kald\u0131r\u0131ld\u0131ktan sonra g\u00f6r\u00fcnmez kalacak.",
    "If you proceed, you will be unable to use this account to take courses on the {platformName} app, {siteName}, or any other site hosted by {platformName}.": "Devam ederseniz, bu hesab\u0131 {platformName} uygulamas\u0131, {siteName} sitesi veya {platformName} taraf\u0131ndan bar\u0131nd\u0131r\u0131lan ba\u015fka herhangi bir sitedeki dersleri almak i\u00e7in kullanamazs\u0131n\u0131z.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "Bu altyaz\u0131y\u0131 kald\u0131r\u0131rsan\u0131z, bu videoyu kullanan herhangi bir bile\u015fen i\u00e7in altyaz\u0131 mevcut olmayacak.",
    "If you remove this transcript, the transcript will not be available for this component.": "Bu altyaz\u0131y\u0131 kald\u0131r\u0131rsan\u0131z, bu bile\u015fen i\u00e7in altyaz\u0131 mevcut olmayacak.",
    "If you require assistance with taking either photo for submission, contact %(platformName)s support for additional suggestions.": "G\u00f6nderim i\u00e7in foto\u011fraf \u00e7ekme konusunda yard\u0131ma ihtiyac\u0131n\u0131z varsa, ek \u00f6neriler i\u00e7in %(platformName)s deste\u011fine ba\u015fvurun.",
    "If you still wish to continue and delete your account, please enter your account password:": "H\u00e2l\u00e2 devam etmek ve hesab\u0131n\u0131z\u0131 silmek istiyorsan\u0131z, l\u00fctfen hesab\u0131n\u0131z\u0131n parolas\u0131n\u0131 girin:",
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "Geli\u015fmi\u015f Edit\u00f6r\u00fc kullan\u0131rsan\u0131z, bu sorun XML'e d\u00f6n\u00fc\u015fecek ve Basit Edit\u00f6r Aray\u00fcz\u00fc'ne geri d\u00f6nemeyeceksiniz.\n\nGeli\u015fmi\u015f Edit\u00f6r'e devam et ve bu sorunu XML'e d\u00f6n\u00fc\u015ft\u00fcr?",
