    "You haven't added any textbooks to this course yet.": "Bu derse herhangi bir ders kitab\u0131 eklemediniz.",
    "You may access your account with this address if single-sign on or access to your primary email is not available.": "SSO oturum a\u00e7ma veya birincil e-postan\u0131za eri\u015fim m\u00fcmk\u00fcn de\u011filse, hesab\u0131n\u0131za bu adresle eri\u015febilirsiniz.",
    "You may also lose access to verified certificates and other program credentials like MicroMasters certificates. If you want to make a copy of these for your records before proceeding with deletion, follow the instructions for {htmlStart}printing or downloading a certificate{htmlEnd}.": "Hesap silme sonras\u0131nda, onaylanm\u0131\u015f sertifikalara ve MicroMasters sertifikalar\u0131 gibi di\u011fer program kimlik bilgilerine de eri\u015femezsiniz. Silme i\u015fleminden \u00f6nce bu kay\u0131tlar\u0131n\u0131z\u0131n bir kopyas\u0131n\u0131 \u00e7\u0131karmak i\u00e7in l\u00fctfen {htmlStart}bir sertifikan\u0131n \u00e7\u0131kt\u0131s\u0131n\u0131 almak ya da indirmek{htmlEnd} \u00f6nergelerini takip edin.",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally the best position for a headshot is approximately 12-18 inches (30-45 centimeters) from the camera, with your head centered relative to the computer screen. ": "G\u00f6r\u00fcnt\u00fc yakalama s\u00fcrecini yard\u0131m almadan tamamlayabilirsiniz, ancak kameran\u0131n do\u011fru konumland\u0131r\u0131lmas\u0131 i\u00e7in birka\u00e7 g\u00f6nderim denemesi gerekebilir. Optimum kamera konumu her bilgisayara g\u00f6re de\u011fi\u015fir, ancak genellikle bir y\u00fcz foto\u011fraf\u0131 i\u00e7in en iyi konum, kafan\u0131z ekran\u0131n\u0131za g\u00f6re ortalanm\u0131\u015f olarak kameradan 12-18 in\u00e7 (30-45 santimetre) uzakl\u0131kt\u0131r. ",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally, the best position for a photo of an ID card is 8-12 inches (20-30 centimeters) from the camera, with the ID card centered relative to the camera. ": "G\u00f6r\u00fcnt\u00fc yakalama s\u00fcrecini yard\u0131m almadan tamamlayabilirsiniz, ancak kameran\u0131n do\u011fru konumland\u0131r\u0131lmas\u0131 i\u00e7in birka\u00e7 g\u00f6nderim denemesi gerekebilir. Optimum kamera konumu her bilgisayara g\u00f6re de\u011fi\u015fir, ancak genellikle bir kimlik kart\u0131n\u0131n foto\u011fraf\u0131 i\u00e7in en iyi konum, kimlik kart\u0131 kameraya g\u00f6re ortalanm\u0131\u015f olarak kameradan 8-12 in\u00e7 (20-30 santimetre) uzakl\u0131kt\u0131r. ",
    "You must be over 13 to share a full profile. If you are over 13, make sure that you have specified a birth year on the {account_settings_page_link}": "T\u00fcm profili payla\u015fmak i\u00e7in 13 ya\u015f\u0131ndan b\u00fcy\u00fck olman\u0131z gerekmektedir. E\u011fer 13 ya\u015f\u0131ndan b\u00fcy\u00fckseniz, {account_settings_page_link} sayfas\u0131nda do\u011fum y\u0131l\u0131n\u0131z\u0131 belirtti\u011finizden emin olun.",
